import NavBar from './components/navbar';

function navBar() {
  return (
    <>
      <NavBar bg="dark" variant="dark">
        <Container>
          <NavBar.Brand href="/mascotas">Ad√≥ptame</NavBar.Brand>
        </Container>
      </NavBar>
    </>
  );
}

export default navBar;
